/* Function  structure for function  `fn_att_employee_code` */

/*!50003 DROP FUNCTION IF EXISTS `fn_att_employee_code` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fn_att_employee_code`(companyid INT, userid INT) RETURNS varchar(12) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
		DECLARE empcode VARCHAR(20);
		SET empcode = (
			SELECT CONCAT('0', (SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.empcode,0)),4), UNSIGNED INT) + 1),4,'0') FROM `att_employee` BB))
			);
		RETURN (empcode);
    END */$$
DELIMITER ;

/* Function  structure for function  `ft_att_m_ablist` */

/*!50003 DROP FUNCTION IF EXISTS `ft_att_m_ablist` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `ft_att_m_ablist`(employeeid int, datefrom Date, dateto DATE ) RETURNS varchar(1000) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
	
	RETURN (
		
		/*SELECT GROUP_CONCAT(CONCAT( DATE_FORMAT(C.vdate,'%d'),':',A.vcode )SEPARATOR ', ') AS returnstr
		FROM att_closing_day AS C 
		INNER JOIN att_setup_attcode AS A ON C.leavetypeid = A.id 
		INNER JOIN att_setup_attgroup AS AG ON A.attgroupid = AG.id
		WHERE C.employeeid= 1070 AND C.vdate BETWEEN datefrom AND dateto
		AND AG.id NOT IN (2,3,4,9,11,16)  
		AND DAYOFWEEK(C.vdate)<> 1
		AND C.vdate NOT IN ( 
			SELECT HH.vdate FROM att_setup_holiday HH WHERE HH.leavetypeid IN (11,16) 
		)*/
		
		SELECT IFNULL(GROUP_CONCAT(C.ablist SEPARATOR ', '), '0') AS returnstr
		FROM `view_att_employee_ablist` AS C 
		WHERE C.employeeid= 1070 AND C.vdate BETWEEN datefrom AND dateto  
	);
	
END */$$
DELIMITER ;

/* Function  structure for function  `fn_att_is_holiday` */

/*!50003 DROP FUNCTION IF EXISTS `fn_att_is_holiday` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fn_att_is_holiday`(companyid INT, userid INT,vdate DATETIME) RETURNS int
    DETERMINISTIC
BEGIN
		
		DECLARE retval INT;
		SET retval = (
			SELECT H.leavetypeid FROM `att_setup_holiday` H where H.vdate= vdate limit 1
			);
		RETURN IFNULL(retval,0) ;
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_att_leave_balance_emp_type` */

/*!50003 DROP FUNCTION IF EXISTS `fn_att_leave_balance_emp_type` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fn_att_leave_balance_emp_type`(empid INT, leavetypeid INT,vdate DATETIME) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN

	SELECT LB.leavelimit, LB.datein, LB.dateout
	into @LeaveTotal, @YearDateFrom, @YearDateTo
	FROM att_setup_attcode AS A 
	INNER JOIN att_setup_attgroup AS AG ON A.attgroupid = AG.id 
	INNER JOIN att_setup_leave_balance AS LB ON AG.id = LB.AttGroupID
	where A.id = leavetypeid and vdate between LB.datein  and LB.dateout;
	
	if ifnull(@LeaveTotal, 0) <= 0 then
	
		return 100;

	else
	
		select SUM((DATEDIFF(L.dateout, L.datein) + 1) * G.pvalue) into @LeaveAvail
		from att_timeentry_leave_apply as L
		INNER JOIN att_setup_attcode AS A ON L.leavetypeid = A.id
		INNER JOIN att_setup_attgroup AS G ON A.attgroupid = G.id
		WHERE A.id = leavetypeid AND L.employeeid = empid AND L.datein BETWEEN @YearDateFrom AND @YearDateTo;
		
		return @LeaveAvail;
	
	end if;
	
END */$$
DELIMITER ;

/* Function  structure for function  `fnAccMaxCode` */

/*!50003 DROP FUNCTION IF EXISTS `fnAccMaxCode` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fnAccMaxCode`(companyid int, userid int, financialyearid int, vtype NVARCHAR(50), vdate Date, monthyear Nvarchar(4)) RETURNS varchar(12) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
	DECLARE vno VARCHAR(20);
	IF vtype IN ('JV','BPV','BRV','CPV','CRV', 'BTV','EXP') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(ifnull(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
			SELECT IFNULL(H.vno,0) vno FROM acc_voucher_main_exp H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.vtype = vtype AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			UNION ALL
			SELECT IFNULL(H.vno,0) vno FROM acc_voucher_main H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.vtype = vtype AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	if vtype IN ('GRN') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM inv_grnb_main H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('ISSUENOTE') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM inv_issuenote_main H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('MRT') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM inv_mortality H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('WST') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM inv_mortality H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('SRV') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM inv_service_main H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('SIV') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM sale_invoice_main H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('PROD') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM prod_reproduction H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('PRDOGP') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
