			)BB)));
	END IF;
	IF vtype IN ('PRDIGP') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM prod_reproduction_igp H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.financialyearid = financialyearid AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('ATTLEAVE') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-', (
			SELECT LPAD((CONVERT(RIGHT(MAX(IFNULL(BB.vno,0)),4), UNSIGNED INT) + 1),4,'0') 
			FROM(
				SELECT IFNULL(H.vno,0) vno FROM att_leave H RIGHT JOIN (SELECT 1 AS vno) AS PROD ON H.vno= PROD.vno AND H.companyid = companyid AND RIGHT(LEFT(H.vno,7), 4)= monthyear
			)BB)));
	END IF;
	IF vtype IN ('ATTSALADVANCE') THEN
		SET vno = (
			SELECT CONCAT(LPAD(CompanyID,2,'0'), '-', (SELECT RIGHT(LEFT(vdate,7),2)), (SELECT RIGHT(LEFT(vdate,4),2)), '-0001')
			);
	END IF;
	RETURN (vno);
END */$$
DELIMITER ;

/* Function  structure for function  `fn_att_absent_list` */

/*!50003 DROP FUNCTION IF EXISTS `fn_att_absent_list` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fn_att_absent_list`(companyid INT, userid INT,
employeeid INT,datefrom datetime,dateto DATETIME
) RETURNS varchar(1000) CHARSET utf8mb4
    DETERMINISTIC
BEGIN

		DECLARE return_str VARCHAR(1000);
		SET return_str = (

SELECT GROUP_CONCAT(CONCAT(DATE_FORMAT(C.vdate,'%d'),':',A.vcode )) AS str
FROM att_closing_day C
INNER JOIN att_setup_attcode A ON A.id = C.leavetypeid
INNER JOIN att_setup_attgroup AG ON AG.id = A.attgroupid
WHERE C.employeeid = employeeid AND AG.id IN (1,12) AND C.vdate BETWEEN datefrom AND dateto
);
		RETURN (return_str);
 
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_rpt_sal_common` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rpt_sal_common` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rpt_sal_common`( userid INT , companyid INT, locationid INT, cwhere VARCHAR(4000),
datefrom DATETIME,dateto DATETIME
)
label: BEGIN
	IF companyid <=0 THEN
	 LEAVE label;
	 END IF ;
	IF userid <=0 THEN
	 LEAVE label;
	 END IF ;
/*SELECT H.id, E.id AS employeeid, E.empcode, E.employeename, E.fathername, E.department, E.designation, E.doj, E.cnicno, 
H.dol, H.isactive,  H.haveot,  H.haveotoff,  H.isstopsalary,  H.shiftid,
H.vdate, H.datefrom,  H.dateto,H.salary, H.salarydays, H.calculatedsalary, H.incometax, H.advance,  H.loan,  H.allowance, H.deduction,
H.overtime,  H.overtimerate,  H.overtimers,  H.isbank, H.chequeno,  H.chequedate,
H.calculatedsalary-H.incometax-H.advance-H.loan+H.allowance-H.deduction+H.overtimers AS netsalary, H.netpayable,  
D.priority , H.financialyearid, 
H.monthdays,  H.workingdays, H.deductiondays,  H.attdays,  H.physicaldays,  H.ppdays,  H.abdays,  H.wedays,  H.hddays,  
H.ghdays,  H.fhdays,  H.cldays,  H.sldays,  H.aldays,  H.cpldays, H.spldays,  H.mldays,  H.shortldays,  H.hdldays,  
H.wodays,  H.latedays,  H.earlydays,  H.salarydays,  
(H.cldays+H.sldays+H.aldays+H.cpldays+H.spldays+H.mldays+H.shortldays/ 4.0+H.hdldays/ 2.0) AS availedleave, 
(H.abdays+H.wodays) AS abdays,  ( H.wedays+H.ghdays+H.fhdays) AS holidays, 
 H.salary*0.0 AS loanbalance 
FROM view_att_employee AS E INNER JOIN att_closing_month AS H ON E.id = H.employeeid INNER JOIN att_setup_dept AS D ON E.deptid = D.id
WHERE   H.vdate BETWEEN '01-aug-2021' AND '31-aug-2021' order by D.priority , E.department,cast(E.empcode as DECIMAL(10,0));
*/
 SET @cSql= CONCAT('
 SELECT H.id, E.id AS employeeid, E.empcode, E.employeename, E.fathername, E.department, E.designation, E.doj, E.cnicno, 
H.dol, H.isactive,  H.haveot,  H.haveotoff,  H.isstopsalary,  H.shiftid, E.shift,
H.vdate, H.datefrom,  H.dateto,H.salary, H.salarydays, H.calculatedsalary, H.incometax, H.advance,  H.loan,  H.allowance1, H.deduction1,
 L.vname AS locationname, (CASE WHEN (H.isbank=0) THEN ''Cash'' ELSE
    (CASE WHEN (H.isbank=1) THEN ''Bank Transfer'' ELSE ''Cheque'' END)     
 END) AS paymentmode, H.comapnybankname ,H.comapnybranchname , H.bankaccount,H.taxablesalary, H.netpayable,
 H.arrears, H.allowance1,H.allowance2,H.allowance3,H.eobideduction,H.ssdeduction,H.deduction1,H.deduction2,H.deduction3, G.vname AS grade, 
 ''ADHOC'' empstatus, ''-'' as ytdincome, ''-''as ytdtax, ''-'' as ntnno,
H.overtime,  H.overtimerate,  H.overtimers,  H.isbank, H.chequeno, H.id*0 AS chequeamount,  H.chequedate,
H.calculatedsalary-H.incometax-H.advance-H.loan+H.allowance1-H.deduction1+H.overtimers AS netsalary, H.netpayable,  
D.priority , H.financialyearid, 
H.monthdays,  H.workingdays, H.deductiondays,  H.attdays,  H.physicaldays,  H.ppdays,  H.abdays,  H.wedays,  H.hddays,  
H.ghdays,  H.fhdays,  H.cldays,  H.sldays,  H.aldays,  H.cpldays, H.spldays,  H.mldays,  H.shortldays,  H.hdldays,  
H.wodays,  H.latedays,  H.earlydays,  H.salarydays,  
(H.cldays+H.sldays+H.aldays+H.cpldays+H.spldays+H.mldays+H.shortldays/ 4.0+H.hdldays/ 2.0) AS availedleave, 
(H.abdays+H.wodays) AS abdays,  ( H.wedays+H.ghdays+H.fhdays) AS holidays, 
0 AS perrmanceallowance, 0 AS specielallowance, 0 AS eidbonus, 0 AS grosssalary, 0 AS loandeductoin, 0 AS leaveswithoutpay, 0 AS otherdeduction, 0 AS totaldeduction, ''-'' AS pmode,
H.salary*0.0 AS loanbalance 
FROM view_att_employee AS E 
INNER JOIN att_closing_month AS H ON E.id = H.employeeid 
INNER JOIN att_setup_dept AS D ON E.deptid = D.id
INNER JOIN att_setup_grade G ON G.id = E.gradeid
INNER JOIN setup_location L ON L.id = E.locationid ' , cwhere,  ' ORDER BY D.priority , E.department,CAST(E.empcode AS DECIMAL(10,0))', '; ');
PREPARE exstr FROM @cSql;
EXECUTE exstr;
DEALLOCATE PREPARE exstr;
END */$$
DELIMITER ;

